const e=JSON.parse('{"key":"v-0614c812","path":"/lc134.html","title":"134. 加油站","lang":"en-US","frontmatter":{"tag":"贪心"},"headers":[],"git":{"createdTime":1728209209000,"updatedTime":1728209209000,"contributors":[{"name":"HouShengming","email":"18865290907@163.com","commits":1}]},"readingTime":{"minutes":0.97,"words":292},"filePathRelative":"lc134.md","localizedDate":"October 6, 2024","excerpt":"<h1> 134. 加油站</h1>\\n<p>在一条环路上有 <code>n</code> 个加油站，其中第 <code>i</code> 个加油站有汽油 <code>gas[i]</code> 升。</p>\\n<p>你有一辆油箱容量无限的的汽车，从第 <code>i</code> 个加油站开往第 <code>i+1</code> 个加油站需要消耗汽油 <code>cost[i]</code> 升。你从其中的一个加油站出发，开始时油箱为空。</p>\\n<p>给定两个整数数组 <code>gas</code> 和 <code>cost</code> ，如果你可以按顺序绕环路行驶一周，则返回出发时加油站的编号，否则返回 <code>-1</code> 。如果存在解，则 <strong>保证</strong> 它是 <strong>唯一</strong> 的。</p>"}');export{e as data};
